import Tool from './Tool'

export default class Eraser extends Tool{
    constructor(canvas){
        super(canvas)
      
       
    }
    
    draw(x, y){
        this.ctx.strokeStyle = "white"
        this.ctx.lineTo(x, y)
        this.ctx.stroke()
        console.log('draw brush')
    }
}
